import { useState } from "react";
import { useNavigate } from "react-router-dom";
import styles from "./Dashboard.module.scss";
import Logo from "../../assets/CI_Logo.png";
import ProfOr from "../../assets/Prof_Or.png";

const LiveClassImage = "https://placehold.co/600x400/e8f1f5/0A4361?text=Live+Class";
const AsyncClassImage = "https://placehold.co/600x400/e8f1f5/0A4361?text=Async+Class";
const Dashboard = () => {
  const navigate = useNavigate();


  return (
    <div className={styles['dashboard-container']}>
      <header className={styles.header}>
        <div className={styles.logo}>
          <img src={Logo} alt="Class Insights Logo" />
        </div>

        <nav className={styles.navigation}>
          <button className={styles.navButton}>New Assignment</button>
          <button className={styles.navButton}>Past Assignments</button>
          <button className={styles.navButton}>AI Settings</button>
          <button className={styles.navButton}>Classes</button>
        </nav>

        <div className={styles.profile}>
          <div className={styles.courseInfo}>
            <span>Business Association</span>
            <span className={styles.courseCode}>LAW100 B</span>
          </div>
          <img src={ProfOr} alt="User Profile" className={styles.profileImage} />
        </div>
      </header>

      <main className={styles.content}>
        <h1>Start Assignment</h1>
        <div className={styles.assignmentCards}>
          <div className={styles.card}>
            <img src={LiveClassImage} alt="Live Class" />
            <h2>Live</h2>
            <p>Real-Time Class Demo</p>
            <button>Begin</button>
          </div>
          <div className={styles.card}>
            <img src={AsyncClassImage} alt="Asynchronous Class" />
            <h2>Asynchronous</h2>
            <p>At-Home Assignments</p>
            <button>Begin</button>
          </div>
        </div>
      </main>
    </div>
  );
};
export default Dashboard;
